import React from "react";

const Scoreboard = () => {
  return (
    <table className="table borderless w-100 lead">
      <tbody>
        <tr style={{ borderBottom: "1px solid white" }}>
          <td scope="col" style={{ padding: 0 }}>
            Event
          </td>
          <td scope="col" style={{ padding: 0 }}>
            Role
          </td>
          <td scope="col" style={{ padding: 0 }}>
            Edit
          </td>
        </tr>
        <tr></tr>
      </tbody>
    </table>
  );
};

export default Scoreboard;
